INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(1, 'Medve a bükkben - Bear in Bükk', 'Medvét találtak a bükkben - Cserkész Tamás válaszol', 'beföld', 'Cserkész Tamás, a Bükki Emlőstani Kutatócsoport Egyesület elnöke pénteken arról számolt be, hogy ők vadkamerák felvételeivel tudják bizonyítani: már hosszabb ideje egy barna medve van a Bükkben.', 'Tamás Cserkész, the president of the Bükk Emlőstani Research Group Association, reported on Friday that they were able to prove with wildlife cameras that there has been a brown bear in Bükk for a long time.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(2, 'Japánban kitört a vulkán - Volcano Eruption in Japan', 'Nagyméretű vulkánkitörés Japán déli részén - Evakuálás folyamatban', 'külföld', 'Nagyméretű vulkánkitörés történt Japán déli részén, több települést érintve. Az embereket evakuálják, és mentőcsapatok indulnak a területre.', 'A large-scale volcanic eruption occurred in the southern part of Japan, affecting several communities. People are being evacuated, and rescue teams are heading to the area.', NULL),
(3, 'Új generációs számítógépek bemutatása - Introduction of Next-Gen Computers', 'A legújabb számítógépek bemutatása, amelyek forradalmasíthatják az informatikát.', 'IT', 'Az informatikát forradalmasító új generációs számítógépek bemutatása. Az új technológiák lehetővé teszik a gyorsabb és hatékonyabb számítási feladatokat.', 'Introduction of the latest computers that can revolutionize the field of IT.', NULL),
(4, 'Magyarországon új öko-park nyílik - New Eco Park in Hungary', 'Magyarországon új öko-park nyílik, ahol az emberek megismerhetik a fenntartható életmódot és a környezetvédelmet.', 'belföld', 'Magyarországon új öko-park nyílik, ahol különböző interaktív tevékenységekkel hozzák közelebb az embereket a fenntartható életmódhoz és a környezetvédelemhez.', 'A new eco park opens in Hungary, where people can learn about sustainable living and environmental conservation through various interactive activities.', NULL),
(5, 'Egyesült Államokban új űrkutatási program indul - New Space Exploration Program in the United States', 'Az Egyesült Államok elindítja új űrkutatási programját, amely célja a Mars felfedezése és a bolygókolonizáció előkészítése.', 'külföld', 'Az Egyesült Államok bejelentette új űrkutatási programját, amely a Mars felfedezésére és a bolygókolonizáció előkészítésére összpontosít.', 'The United States announces a new space exploration program with the goal of exploring Mars and preparing for planetary colonization.', NULL),
(6, 'Legújabb iPhone modell bemutatása - Introduction of the Latest iPhone Model', 'Az Apple bemutatja legújabb iPhone modelljét, amely új funkciókat és fejlett technológiát kínál a felhasználók számára.', 'IT', 'Az Apple bemutatja legújabb iPhone modelljét, amely továbbfejlesztett kamerákkal, nagyobb teljesítménnyel és új funkciókkal rendelkezik.', 'Apple introduces the latest iPhone model with enhanced cameras, improved performance, and new features.', NULL),
(7, 'Magyarországon új gyorsvasúti vonal megnyitása - Opening of New High-Speed Rail Line in Hungary', 'Magyarországon megnyílik egy új gyorsvasúti vonal, amely csökkenti az utazási időt a főváros és más nagyvárosok között.', 'belföld', 'Magyarországon új gyorsvasúti vonal nyílik, amely lehetővé teszi a gyorsabb és kényelmesebb közlekedést a főváros és más nagyvárosok között.', 'A new high-speed rail line opens in Hungary, reducing travel time between the capital and other major cities.', NULL),
(8, 'Magyarországon megnyílt az új nemzeti múzeum - Opening of the New National Museum in Hungary', 'Magyarországon megnyílt az új nemzeti múzeum, amely bemutatja az ország történetét és kulturális örökségét.', 'belföld', 'Magyarországon megnyílt az új nemzeti múzeum, amely az ország gazdag történelmét és kulturális örökségét mutatja be interaktív kiállításokon keresztül.', 'The new national museum has opened in Hungary, showcasing the country\'s rich history and cultural heritage through interactive exhibitions.', NULL),
(9, 'Európai Unióban új klímavédelmi stratégia - New Climate Protection Strategy in the European Union', 'Az Európai Unió bejelentette új klímavédelmi stratégiáját, amely a szén-dioxid kibocsátás csökkentését és az obnovatechnológiák előmozdítását célozza meg.', 'külföld', 'Az Európai Unió új klímavédelmi stratégiát jelentett be, amelynek célja a szén-dioxid kibocsátás csökkentése és az obnovatechnológiák előmozdítása a klímaváltozás elleni küzdelemben.', 'The European Union announces a new climate protection strategy aimed at reducing carbon dioxide emissions and promoting renewable technologies in the fight against climate change.', NULL),
(10, 'A mesterséges intelligencia új áttörése - New Breakthrough in Artificial Intelligence', 'A kutatók bejelentették az újabb áttörést a mesterséges intelligencia területén, amely új lehetőségeket nyit meg a gépi tanulás és az automatizáció terén.', 'IT', 'A kutatók bejelentették az újabb áttörést a mesterséges intelligencia területén, amely új lehetőségeket nyit meg a gépi tanulás és az automatizáció terén, javítva az AI rendszerek teljesítményét és hatékonyságát.', 'Researchers announce a new breakthrough in the field of artificial intelligence, opening up new possibilities in machine learning and automation, improving the performance and efficiency of AI systems.', NULL),
(11, 'Kína bejelentette az új űrállomás projektet - China Announces New Space Station Project', 'Kína bejelentette új űrállomás projektjét, amely célja a kínai űrkutatás fejlesztése és nemzetközi együttműködés az űrben.', 'külföld', 'Kína bejelentette új űrállomás projektjét, amely célja a kínai űrkutatás fejlesztése és nemzetközi együttműködés az űrben, elősegítve a tudományos kutatást és az űrkutatási erőfeszítéseket.', 'China announces a new space station project aimed at advancing Chinese space exploration and fostering international cooperation in space, promoting scientific research and space exploration efforts.', NULL),
(12, 'Quantum számítógépek fejlesztése a Google-nél - Development of Quantum Computers at Google', 'A Google bejelentette, hogy folytatja a quantum számítógépek fejlesztését, amelyek forradalmasíthatják a számítástechnikát.', 'IT', 'A Google bejelentette, hogy folytatja a quantum számítógépek fejlesztését, amelyek forradalmasíthatják a számítástechnikát, új lehetőségeket teremtve a kódolásban és az adatfeldolgozásban.', 'Google announces the continuation of the development of quantum computers that have the potential to revolutionize computing, creating new possibilities in coding and data processing.', NULL),
(13, 'Magyarországon nő az elektromos autók népszerűsége - Increase in Popularity of Electric Cars in Hung', 'Magyarországon nő az elektromos autók népszerűsége, amelyeket a kormány támogatása is elősegít.', 'belföld', 'Magyarországon nő az elektromos autók népszerűsége, amelyeket a kormány támogatása is elősegít. Az emberek egyre inkább választják a fenntarthatóbb közlekedési megoldásokat.', 'The popularity of electric cars is increasing in Hungary, supported by government incentives. People are increasingly choosing more sustainable transportation solutions.', NULL),
(14, 'Egyesült Királyságban új klímavédelmi törvény elfogadása - Adoption of New Climate Protection Law in', 'Az Egyesült Királyság elfogadja új klímavédelmi törvényét, amely célja a szénsemlegesség elérése és a klímaváltozás elleni küzdelem megerősítése.', 'külföld', 'Az Egyesült Királyság elfogadja új klímavédelmi törvényét, amely célja a szénsemlegesség elérése és a klímaváltozás elleni küzdelem megerősítése, vállalva a zöld energiába történő átmenetet.', 'The United Kingdom adopts a new climate protection law aimed at achieving carbon neutrality and strengthening the fight against climate change, committing to transitioning into green energy.', NULL),
(15, 'Új szuperszámítógép beüzemelése az Európai Űrügynökségnél - Activation of New Supercomputer at the E', 'Az Európai Űrügynökség beüzemelte új szuperszámítógépét, amely segíti az űrkutatási és meteorológiai modellek fejlesztését.', 'IT', 'Az Európai Űrügynökség beüzemelte új szuperszámítógépét, amely segíti az űrkutatási és meteorológiai modellek fejlesztését. A rendszer elősegíti a pontosabb időjárási előrejelzéseket és űrkutatási szimulációkat.', 'The European Space Agency activates its new supercomputer, aiding in the development of space exploration and meteorological models. The system facilitates more accurate weather forecasts and space exploration simulations.', NULL);

